window.bookSummaryJSON = "<p>Callyn Silvers is the quiet girl in class, with her nose always in a book. No matter what school she's in, she likes to fly under the radar, and is hoping that senior year, at yet another new school, will be the same. </p> <p>Enter Zeke Montgomery, Graydon James, Maximus Anderson, and Lucian Harris. They enter Callyn's life like a Category 5 hurricane. All the boys recognize who she is the moment they see and scent her. </p> <p>She is their mate. <br> All of their mates. </p> <p>Information comes to light. Callyn and the boy's futures will be changed. They will bring about a change. A change some do not want to happen. </p> <p><i>Contains mature themes.</i></p>"; 
